import { configureStore, apiMiddleware, loggerMiddleware } from '@reduxjs/toolkit';
const middleware = [apiMiddleware, loggerMiddleware]

const store = configureStore({
  reducer: { 
    user: userReducer,
    chessboard: chessboardReducer
  },
  middleware: [...middleware]
});
